INSERT INTO `pro_offline` (`id`, `edo_pro_id`, `edo_name`, `edo_description`, `edo_objective`, `edo_details`, `edo_details_objective1`, `edo_details_objective2`, `edo_details_objective3`, `edo_details_objective4`, `edo_tex`, `img_file`, `img_banner`, `dateCreate`) VALUES
(1, '121205', 'บริจาคเพื่อการศึกษา เพื่อเป็นทุนการศึกษานักศึกษาพยาบาลศาสตร์  มหาวิทยาลัยเชียงใหม่', 'บริจาคเพื่อการศึกษา เพื่อเป็นทุนการศึกษานักศึกษาพยาบาลศาสตร์  มหาวิทยาลัยเชียงใหม่', 'บริจาคเพื่อการศึกษา เพื่อเป็นทุนการศึกษานักศึกษาพยาบาลศาสตร์  มหาวิทยาลัยเชียงใหม่', 'คณะพยาบาลศาสตร์ มช. เป็นสถาบันการศึกษาพยาบาลที่ผลิตบัณฑิตพยาบาล ที่เป็นกำลังสำคัญในระบบสาธารณสุขของประเทศ แต่ละปีมีนักศึกษาที่อยู่ระหว่างการศึกษาทุกระดับมากกว่า 1,500 คน คณะฯ ตระหนักถึงความสำคัญของการให้โอกาสทางการศึกษา และมุ่งหวังที่จะสนับสนุนและส่งเสริมให้นักศึกษาได้มีโอกาสเรียนรู้จนสำเร็จการศึกษาภายในระยะเวลาที่กำหนดไว้ในหลักสูตร โครงการนี้จัดตั้งขึ้นเพื่อมอบทุนการศึกษาแก่นักศึกษาพยาบาลทุกระดับที่ขาดแคลน ทุนทรัพย์ ให้สามารถจ่ายค่าธรรมเนียมการศึกษา ค่าที่พักอาศัย และค่าใช้จ่ายในการดำรงชีพ ซึ่งจะช่วยให้นักศึกษาได้ใช้เวลาในการศึกษาเล่าเรียนอย่างเต็มศักยภาพ รวมทั้งเป็นรางวัลสำหรับนักศึกษาผู้ที่มีผลการเรียนและผลการฝึกปฏิบัติยอดเยี่ยม  ดังนั้นเมื่อสำเร็จการศึกษา นักศึกษาจะได้นำความรู้และทักษะทางการพยาบาลมาช่วยเหลือดูแลผู้ป่วย ครอบครัว และสังคมต่อไป', 'โครงการทุนการศึกษาเพื่อนักศึกษาคณะพยาบาลศาสตร์ มหาวิทยาลัยเชียงใหม่', '', '', '', 'บริจาคเพื่อลดหย่อนภาษี 2 เท่า', 'DSC_8522.jpg', 'banner_tex1.jpg', '2023-09-27 04:32:52'),
(2, '121206', 'บริจาคเพื่อระดมพลัง เร่งรัดปรับปรุงคุณภาพ คณะพยาบาลศาสตร์ มหาวิทยาลัยเชียงใหม่', 'บริจาคเพื่อสนับสนุนการศึกษาคณะพยาบาลศาสตร์ มหาวิทยาลัยเชียงใหม่', 'บริจาคเพื่อสนับสนุนการศึกษาคณะพยาบาลศาสตร์ มหาวิทยาลัยเชียงใหม่', 'คณะพยาบาลศาสตร์ มช. เปิดดำเนินการจัดการเรียนการสอนและได้ผลิตบัณฑิตคณะพยาบาลศาสตร์ ออกไปรับใช้สังคมทั้งไทยและต่างประเทศมามากกว่า 60 ปี ปัจจุบันคณะพยาบาลศาสตร์ มีอาคารเรียนทั้งหมด 4 อาคาร ในการดำเนินการตามพันธกิจของคณะฯ จำเป็นต้องมีการพัฒนาปรับปรุงห้องเรียน อาคารเรียน อาคารสถานที่ และสภาพแวดล้อมภูมิทัศน์อย่างต่อเนื่อง เพื่อให้อาคารสถานที่และสิ่งแวดล้อม สะอาด ร่มรื่น สวยงาม ปลอดภัย และมีบรรยากาศเอื้ออำนวยต่อการเรียนการสอนของอาจารย์ นักศึกษา บุคลากร และผู้รับบริการทุกกลุ่มมีความพึงพอใจ ', 'เพื่อจัดสร้างอาคารและปรับปรุงอาคารเรียน คณะพยาบาลศาสตร์ มหาวิทยาลัยเชียงใหม่', 'เพื่อจัดหาวัสดุอุปกรณ์การศึกษาคณะพยาบาลศาสตร์ มหาวิทยาลัยเชียงใหม่', '', '', 'บริจาคเพื่อลดหย่อนภาษี 2 เท่า', 'DSC_2926.jpg', 'banner_tex2.jpg', '2023-09-27 04:32:56'),
(3, '121207', 'บริจาคเพื่อสาธารณะประโยชน์และการกุศลอื่น ๆ', 'บริจาคเพื่อสาธารณะประโยชน์และการกุศลอื่นๆ', 'บริจาคเพื่อสาธารณะประโยชน์และการกุศลอื่นๆ', 'คณะพยาบาลศาสตร์ มช. เป็นสถาบันการศึกษาพยาบาลที่ผลิตบัณฑิตพยาบาล ที่เป็นกำลังสำคัญในระบบสาธารณสุขของประเทศ ที่ไม่ได้มุ่งหวังแค่การรักษาพยาบาลประชาชนเมื่อเจ็บป่วยเท่านั้น แต่มุ่งหวังให้ประชาชนมีสุขภาวะกายและจิตที่ดี ผ่านกระบวนการสร้างเสริมสุขภาพ ป้องกันโรค รักษาโรค และฟื้นฟูสภาพ คณะฯ ตระหนักถึงความยากลำบาก และความไม่เท่าเทียมกันของประชาชนในกลุ่มและพื้นที่ต่างๆ ที่ยังมีช่องว่างในการเข้าถึงบริการสาธารณสุขขั้นพื้นฐานที่มีคุณภาพ ดังนั้นคณะฯมีความมุ่งมั่นตั้งใจที่จะช่วยเหลือผู้ยากไร้ ผู้ด้อยโอกาสในสังคม ผู้ที่ขาดโอกาสในการเข้าถึงบริการสาธารณสุข ตลอดจนผู้ที่ขาดโอกาสด้านการศึกษาในสังคม โดยการรวบรวมเงินบริจาคเพื่อแบ่งปันเอื้ออาทร ช่วยเหลือซึ่งกันและกัน', 'บริจาคเพื่อผู้ยากไร้และผู้ด้อยโอกาสในสังคม', 'บริจาคเพื่อเพื่อนร่วมวิชาชีพพยาบาลที่ประสบภัยจากการปฏิบัติงานในหน้าที่ ', 'บริจาคเพื่อสนับสนุนโครงการนักศึกษาพยาบาล มช. ส่งต่อความดีเพื่อสังคม', 'บริจาคเพื่อครอบครัวคณะพยาบาลศาสตร์ มช. ที่ประสบความเดือดร้อน', 'บริจาคเพื่อลดหย่อนภาษี 1 เท่า', 'DSC_2927.jpg', 'banner_tex2.jpg', '2023-09-27 04:33:02');
